http://www.w3.org/2000/01/rdf-schema#com.value:
The 2011 AFC Asian Cup qualification saw various countries take part to determine 10 spots to the final tournament in Qatar under the new qualification system set by the Asian Football Confederation (AFC). Six other teams also qualified for the finals, even though they did not take part in the qualifiers: 
* The host nation: Qatar; 
* The top three finishers in the 2007 tournament: Iraq, Saudi Arabia and Korea Republic; 
* The winner of the 2008 AFC Challenge Cup: India; 
* The winner of the 2010 AFC Challenge Cup: Korea DPR.

Kualifikasi Piala Asia AFC diselenggarakan untuk menentukan 10 negara yang akan mengikuti putaran final kejuaraan di Qatar dengan sistem kualifikasi yang baru oleh under Konfederasi Sepak Bola Asia (AFC). Enam tim lainnya yang lolos langsung ke putaran final tanpa kualifikasi adalah: 
* Tuan Rumah: Qatar; 
* Tiga besar pada Piala Asia 2007: Irak, Arab Saudi, dan Korea Selatan; 
* Juara : India; 
* Juara : Korea Utara.

